export const fetchPolicies = (policies: any) => {
  return {
    type: 'FETCH_POLICIES',
    payload: policies
  }
}

export const fetchErrors = (error: string) => {
  return {
    type: 'FETCH_ERRORS',
    payload: error
  }
}
